import React, { useState } from "react";
import './styles/App.css';
import PostItem from "./components/PostItem";

function App() {
  const [posts, setPosts] = useState([
    {id: 1, title: 'JavaScript', body: 'JS Description'},
    {id: 2, title: 'Python', body: 'JS Description'},
    {id: 3, title: '.NET', body: 'JS Description'}
  ])

  return (
    <div className="App">
      <PostItem post={{id: 1, title: 'JavaScript', body: 'JS Description'}}/>
      <PostItem post={{id: 2, title: 'JavaScript', body: 'JS Description'}}/>
      <PostItem post={{id: 3, title: 'JavaScript', body: 'JS Description'}}/>

    </div>
  );
}

export default App;
